4. **Word Extraction and Counting**: For each line, it removes the leading space from the substring starting with the word to be counted and splits the line into words.
5. **Case-Insensitive Comparison**: It converts the word to lowercase to ensure case-insensitive counting.
6. **Counting Occurrences**: It increments the count each time the word matches.
7. **Output**: Finally, it prints the number of occurrences.

### Usage:

1. Compile the program using a C++ compiler, for example:
   ```sh
   g++ -o count_word count_word.cpp
   ```
2. Run the compiled program:
   ```sh
  ./count_word
   ```
3. Enter the word you want to count when prompted.
4. The program will output the number of occurrences of the specified word in the file.

This program assumes that words are separated by spaces and does not handle punctuation or multiple occurrences of the same word with different cases. If you need more advanced word counting (e.g., handling different cases or ignoring punctuation), additional processing would be required.
